apiVersion: apps/v1
kind: StatefulSet
metadata:
  labels:
    app: keycloak
    app.kubernetes.io/instance: keycloak
    app.kubernetes.io/managed-by: Helm
    app.kubernetes.io/name: postgres
    app.kubernetes.io/version: "18.0"
    helm.sh/chart: postgres-0.9.0
    tfm/cluster-group: keycloak
    tfm/name: keycloak
  name: keycloak-postgres
  namespace: keycloak
spec:
  replicas: 1
  selector:
    matchLabels:
      app: keycloak
      app.kubernetes.io/instance: keycloak
      app.kubernetes.io/name: postgres
      tfm/cluster-group: keycloak
      tfm/name: keycloak
  serviceName: keycloak-postgres-headless
  template:
    metadata:
      labels:
        app: keycloak
        app.kubernetes.io/instance: keycloak
        app.kubernetes.io/managed-by: Helm
        app.kubernetes.io/name: postgres
        app.kubernetes.io/version: "18.0"
        helm.sh/chart: postgres-0.9.0
        tfm/cluster-group: keycloak
        tfm/name: keycloak
    spec:
      automountServiceAccountToken: false
      containers:
        - args:
            - -c
            - config_file=/etc/postgresql/postgresql.conf
          env:
            - name: PGDATA
              value: /var/lib/postgresql/18/docker
            - name: POSTGRES_DB
              value: keycloak
            - name: POSTGRES_PASSWORD
              valueFrom:
                secretKeyRef:
                  key: postgres-password
                  name: keycloak-postgres
            - name: POSTGRES_MAX_CONNECTIONS
              value: "100"
          image: docker.io/postgres:18.0@sha256:073e7c8b84e2197f94c8083634640ab37105effe1bc853ca4d5fbece3219b0e8
          imagePullPolicy: Always
          livenessProbe:
            exec:
              command:
                - /bin/bash
                - -c
                - |
                  pg_isready -U postgres -d keycloak -h 127.0.0.1 -p 5432
            failureThreshold: 3
            initialDelaySeconds: 30
            periodSeconds: 10
            successThreshold: 1
            timeoutSeconds: 5
          name: postgres
          ports:
            - containerPort: 5432
              name: postgresql
              protocol: TCP
          readinessProbe:
            exec:
              command:
                - /bin/bash
                - -c
                - |
                  pg_isready -U postgres -d keycloak -h 127.0.0.1 -p 5432
            failureThreshold: 3
            initialDelaySeconds: 5
            periodSeconds: 5
            successThreshold: 1
            timeoutSeconds: 5
          resources: {}
          securityContext:
            allowPrivilegeEscalation: false
            capabilities:
              drop:
                - ALL
            readOnlyRootFilesystem: false
            runAsGroup: 999
            runAsNonRoot: true
            runAsUser: 999
          startupProbe:
            exec:
              command:
                - /bin/bash
                - -c
                - |
                  pg_isready -U postgres -d keycloak -h 127.0.0.1 -p 5432
            failureThreshold: 30
            initialDelaySeconds: 30
            periodSeconds: 10
            successThreshold: 1
            timeoutSeconds: 5
          volumeMounts:
            - mountPath: /var/lib/postgresql
              name: data
            - mountPath: /etc/postgresql
              name: config
            - mountPath: /var/run/postgresql
              name: run
            - mountPath: /tmp
              name: tmp
      securityContext:
        fsGroup: 999
      serviceAccountName: default
      volumes:
        - configMap:
            name: keycloak-postgres
            optional: true
          name: config
        - emptyDir: {}
          name: run
        - emptyDir: {}
          name: tmp
  updateStrategy:
    type: RollingUpdate
  volumeClaimTemplates:
    - metadata:
        labels:
          app: keycloak
          tfm/cluster-group: keycloak
          tfm/name: keycloak
        name: data
      spec:
        accessModes:
          - ReadWriteOnce
        resources:
          requests:
            storage: 8Gi
